import styled from "styled-components";

export const Botao = styled.button`
  border: 0;
  font-family: "Roboto", system-ui;
  cursor: pointer;
  padding: 10px;
  border-radius: 4px;

  &:hover {
    background-color: aliceblue;
  }
`;
